// creating navbar component
function Navbar()
{
  return(
    <div className="navbar">
      <h1>Perfumy</h1>
      <ul>
        <li>Home</li>
        <li>Products</li>
        <li>About</li>
        <li>Contact</li>
      </ul>
    </div>
  )
}

export default Navbar
